import React from 'react';
import {useLocation} from 'react-router-dom'

export default function CostumerDetails(props) {

    const costumersArray = props.costumersArray;
    const location = useLocation();
    const { costumerData } = location.state;
    console.log(costumerData);

    return (
      <div>
        <p style={{ border: "2px solid blue", width: "100px",color:'white' }}>
          {costumerData.name}
        </p>
        <p style={{ border: "2px solid blue", width: "100px" }}>
          {costumerData.id}
        </p>
        <p style={{ border: "2px solid blue", width: "100px" }}>
          {costumerData.address}
        </p>
        <p style={{ border: "2px solid blue", width: "100px" }}>
          {costumerData.phoneNumber}
        </p>
        <p style={{ border: "2px solid blue", width: "100px" }}>
          {costumerData.plateNumber}
        </p>
      </div>
    );
}
